import React from 'react'
import { Progress } from 'antd';
import styled from 'styled-components'

const StatsWrapper = styled.div`

margin:3rem 0;
    h3{
        margin-bottom:1.5rem;
    }

`;

const Stats = () => {
    return (
        <StatsWrapper>
            <h3>Some Stats from your todos</h3>
        </StatsWrapper>
    )
}

export default Stats
